!function(){"use strict";var ws=new WebSocket("ws://"+location.hostname+":80");function eventConfig(e){let d_div=e.target.closest("div");if("click"==e.type&&d_div)if("submit"==d_div.id){var data={cmd:"save_settings",wifi_ssid:document.getElementById("wifi_ssid").value,wifi_pass:document.getElementById("wifi_pass").value};console.log("Saving settings..."),ws.send(JSON.stringify(data))}else if("reset_bag"==d_div.id){data={cmd:"reset_bag",volume_ml:500};console.log("Saving settings..."),ws.send(JSON.stringify(data))}}ws.onmessage=function(evt){document.getElementById("output").value=evt.data},window.addEventListener("click",eventConfig),window.onload=function(){!function(){document.getElementById("wifi_ssid").value=params.ssid,document.getElementById("wifi_pass").value=params.pass;var wifiStatus=params.wifi_status;console.log("WifiStatus: "+wifiStatus);var wifiText="Not connected to internet";"1"==wifiStatus&&(wifiText="Connected to internet"),document.getElementById("wifi_status").innerHTML=wifiText}()}}();